svg.script:
function getParams() {
  const params = {};
  location.search.substring(1).split("&").forEach(function(pair){
    const [key, value] = pair.split("=");
    if(key) params[key] = decodeURIComponent(value);
  });
  return params;
}
const p = getParams();
if(p.sub) document.getElementById("subText").textContent = p.sub;
